    "author": "Barış Örün",
    "key": "Am",
    "lyrics": [
      {
        "section": "V1",
        "chord": [
          "Am"
        ],
        "line": "İşte bulutlarla geliyor!"
      },
      {
        "section": "V1",
        "chord": [
          "F"
        ],
        "line": "Her göz O'nu görüyor."
      },
      {
        "section": "V1",
        "chord": [
          "G"
        ],
        "line": "Bedenini deşmiş olanlar,"
      },
      {
        "section": "V1",
        "chord": [
          "Am"
        ],
        "line": "O'nun için dövünüyor."
      },
      {
        "section": "C1",
        "chord": [
          "F"
        ],
        "line": "Yeryüzündeki bütün halklar."
      },
      {
        "section": "C1",
        "chord": [
          "G"
        ],
        "line": "Kaldırın başınızı geliyor."
      },
      {
        "section": "C1",
        "chord": [
          "Am"
        ],
        "line": "Var olan, var olmuş ve gelecek olan,"
      },
      {
        "section": "C1",
        "chord": [
          "Dm",
          "Esus4",
          "Am"
        ],
        "line": "Her Şeye Gücü Yeten Rab Tanrı   geliyor. //"
      },
      {
        "section": "V2",
        "chord": [
          "Am"
        ],
        "line": "Ağzında iki ağızlı kılıcı,"
      },
      {
        "section": "V2",
        "chord": [
          "F"
        ],
        "line": "Ateş gibi alev alev gözleri,"
      },
      {
        "section": "V2",
        "chord": [
          "G"
        ],
        "line": "Su gibi, gürül gürüldür Sesi,"
      },
      {
        "section": "V2",
        "chord": [
          "Am"
        ],
        "line": "İşte bulutlarla geliyor."
      },
      {
        "section": "V2",
        "chord": [
          "Am"
        ],
        "line": "İnsanoğluna benzer biri,"
      },
      {
        "section": "V2",
        "chord": [
          "F"
        ],
        "line": "İlk ve Son, Ben'im dedi."
      },
      {
        "section": "V2",
        "chord": [
          "G"
        ],
        "line": "Sonsuzluklar boyunca Diri"
      },
      {
        "section": "V2",
        "chord": [
          "Am"
        ],
        "line": "İşte bulutlarla geliyor."
      }
    ]
